import React from "react";
import { Header } from "./Header"
import "./styles.css";

const Main = () => {
  const handleOnClick = () => {
    window.open(
      "http://localhost:3000/agregar", "_blank");
  }

  return (
    <>
      <Header titulo='Mis Tareas' />
      <main className="main bg-light">
        <button className='btn btn-dark' onClick={handleOnClick}>Agregar Tareas</button>
      </main>
    </>
  );
};

export { Main };
